INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (14304, 0, 'Ozanimod', 'Cardiovascular Diseases', 'Ozanimod is contraindicated in patients who have had a recent myocardial infarction, those with unstable angina, stroke, transient ischemic attack, decompensated heart failure with hospitalization, or Class III/IV heart failure, a presence of Mobitz Type II 2nd degree or 3rd degree AV block, sick sinus syndrome, or sino-atrial block, unless the patient has a pacemaker, severe untreated sleep apnea or those patients being treated with monoamine oxidase inhibitor drugs.', '3', '', 'DDInter', 0);
INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (14305, 0, 'Ozanimod', 'Cardiac Conduction System Disease', 'The use of ozanimod may result in a transient decrease in heart rate and atrioventricular conduction delays upon starting treatment.  It is recommended to follow an up-titration scheme to reach the maintenance dosage.  Initiation of ozanimod without titration may result in greater decreases in heart rate.  If treatment with ozanimod is considered, advice from a cardiologist should be sought for those individuals at risk of cardiovascular effects, particularly conduction delays.', '2', '', 'DDInter', 0);
INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (14306, 0, 'Ozanimod', 'Hypertension', 'The use of ozanimod may result in increased blood pressure.  Care should be exercised when using this drug in hypertensive patients and those at risk for hypertension.  It is recommended to monitor blood pressure during treatment and manage it according to clinical practices.', '2', '', 'DDInter', 0);
INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (14307, 0, 'Ozanimod', 'Infections', 'Ozanimod may increase the risk of infections and some serious infections with opportunistic pathogens including viruses have been reported.  Because of reversible sequestration of lymphocytes in lymphoid tissues, this drug causes a mean reduction in peripheral blood lymphocyte count to approximately 45% of baseline values.  Prior to treatment, a recent CBC (i.e., within 6 months or after discontinuation of prior therapy), including lymphocyte count must be available.  It is recommended to delay treatment initiation in patients with an active infection until complete resolution.  Consider withholding or discontinuing treatment if a patient develops a serious infection, and reassess the benefits and risks prior to reinitiating therapy.', '2', '', 'DDInter', 0);
INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (14308, 0, 'Ozanimod', 'Liver Diseases', 'The use of ozanimod may result in elevations of aminotransferases.  The use of ozanimod in patients with hepatic impairment is not recommended.  While on treatment with this drug, if a patient develop symptoms suggestive of hepatic dysfunction, such as unexplained nausea, vomiting, abdominal pain, fatigue, anorexia, or jaundice and/or dark urine, should have hepatic enzymes checked, and ozanimod should be discontinued if significant liver injury is confirmed.', '2', '', 'DDInter', 0);
INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (14309, 0, 'Ozanimod', 'Respiratory Insufficiency', 'The use of ozanimod may result in a dose-dependent reduction in absolute forced expiratory volume over 1 second (FEV1) and may manifest as early as 3 months after treatment initiation.  Care should be exercised when using this drug in patients with respiratory complications.  It is recommended to perform spirometric evaluation of respiratory function during therapy if clinically appropriate.', '2', '', 'DDInter', 0);
INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (14310, 0, 'Ozanimod', 'Brain Diseases', 'Rare cases of posterior reversible encephalopathy syndrome (PRES) have been reported in patients receiving a sphingosine 1-phosphate receptor modulator.  It is recommended to promptly schedule a complete physical and neurological examination and should consider an MRI, if a patient develops any unexpected neurological or psychiatric symptoms/signs, any symptom/sign suggestive of an increase of intracranial pressure, or accelerated neurological deterioration.  Delay in diagnosis and treatment may lead to permanent neurological sequelae.  Exercise care when using this agent in patients with a history of ischemic stroke or cerebral hemorrhage.  Treatment should be discontinued if PRES is suspected.', '2', '', 'DDInter', 0);
INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (14311, 0, 'Ozanimod', 'Macular Edema', 'Macular edema has been reported with the use of sphingosine 1-phosphate (S1P) receptor modulators.  Care should be exercised when using these drugs in patients with a history of uveitis and patients with diabetes mellitus as these patients are at increased risk for macular edema.  Before starting treatment with these agents, an ophthalmic evaluation of the fundus, including the macula, is recommended in all patients and at any time if vision change is reported during treatment.  Patients with a history of uveitis and patients with diabetes mellitus should have regular follow-up examinations of the fundus, including the macula during treatment.  Continuation of therapy in patients with macular edema has not been evaluated, therefore, a decision on whether or not to discontinue treatment needs to take into account the potential benefits and risks for the individual patients.', '2', '', 'DDInter', 0);
INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (14312, 0, 'Ozanimod', 'Multiple Sclerosis', 'Rare cases of severe exacerbation of multiple sclerosis (MS), including disease rebound, have been reported after discontinuation of sphingosine 1-phosphate receptor modulator in MS treated patients.  The possibility of severe exacerbation of disease should be considered after stopping treatment with these agents.  Patients should be observed for a severe increase in disability upon discontinuation and appropriate treatment should be instituted, as required.', '2', '', 'DDInter', 0);
INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (14313, 8130, 'Palbociclib', 'Lung Diseases', 'The use of certain multikinase inhibitors has been associated with pulmonary toxicity.  Serious cases of interstitial lung disease (ILD), including fatal cases and interstitial pneumonitis or pulmonary fibrosis have been reported.  Caution is recommended when using these agents in patients with a history of interstitial pneumonitis or pulmonary fibrosis or those patients presenting with acute onset of new or progressive unexplained pulmonary symptoms such as dyspnea, cough, and fever pending diagnostic evaluation.  If ILD is confirmed, permanently discontinue these agents and institute appropriate measures.  Immediately withhold treatment in patients diagnosed with ILD/pneumonitis and permanently discontinue therapy if no other potential causes of ILD/pneumonitis have been identified.', '2', '', 'DDInter', 0);
