INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (14317, 8130, 'Palbociclib', 'Hepatic Insufficiency', 'Based on a population pharmacokinetic analysis with palbociclib mild hepatic impairment had no effect on the exposure of palbociclib.  Close monitoring is recommended when using this agent in patients with moderate or severe hepatic impairment as the pharmacokinetics of palbociclib have not been studied in these patients.  Dose modification of concomitant medications may be needed based of hepatic impairment.', '2', '', 'DDInter', 0);
