INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (14321, 8130, 'Palbociclib', 'Neutropenia', 'The use of palbociclib may cause neutropenia, including febrile neutropenia and neutropenic sepsis.  It is recommended to monitor complete blood counts prior to starting treatment and at the beginning of each therapy cycle with palbociclib, as well as on Day 15 of the first 2 cycles, and as clinically indicated thereafter.  Dose interruption, dose reduction, or delay in starting treatment cycles is recommended for patients who develop Grade 3 or 4 neutropenia.  Care and close monitoring is recommended, in particular for any episodes of fever.', '2', '', 'DDInter', 0);
