INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (14325, 8130, 'Palbociclib', 'Premenopausal', 'Pre/perimenopausal women treated with the combination palbociclib plus fulvestrant therapy should be treated with luteinizing hormone-releasing hormone (LHRH) agonists according to current clinical practice standards.  Care and close monitoring is recommended.', '2', '', 'DDInter', 0);
